import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import { compose } from 'recompose';
import { MDBContainer, MDBRow, MDBCol, MDBBtn, MDBCard, MDBInput } from 'mdbreact';


import { SignUpLink } from '../SignUp';
import { PasswordForgetLink } from '../PasswordForget';
import { withFirebase } from '../Firebase';
import * as ROUTES from '../../../src/constants/routes';

const SignInPage = () => (
    <div>
        <h1>SignIn</h1>
        <SignInForm />
        <PasswordForgetLink />
        <SignUpLink />
    </div>
);

const INITIAL_STATE = {
    email: '',
    password: '',
    error: null,
};

class SignInFormBase extends Component {
    constructor(props) {
        super(props);

        this.state = { ...INITIAL_STATE };
    }

    onSubmit = event => {
        const { email, password } = this.state;

        this.props.firebase
            .doSignInWithEmailAndPassword(email, password)
            .then(() => {
                this.setState({ ...INITIAL_STATE });
                this.props.history.push(ROUTES.HOME);
            })
            .catch(error => {
                this.setState({ error });
            });

        event.preventDefault();
    };

    onChange = event => {
        this.setState({ [event.target.name]: event.target.value });
    };

    render() {
        const { email, password, error } = this.state;

        const isInvalid = password === '' || email === '';

        return (
            <MDBContainer>
                <MDBRow>
                    <MDBCol md="6">
                        <MDBCard
                            className="card-image"
                            style={{
                                backgroundImage:
                                    "url(https://mdbootstrap.com/img/Photos/Others/pricing-table7.jpg)",
                                width: "28rem"
                            }}
                        >
                            <div className="text-white rgba-stylish-strong py-5 px-5 z-depth-4">
                                <div className="text-center">
                                    <h3 className="white-text mb-5 mt-4 font-weight-bold">
                                        <strong>SIGN</strong>
                                        <a href="#!" className="green-text font-weight-bold">
                                            <strong> UP</strong>
                                        </a>
                                    </h3>
                                </div>
                                <MDBInput label="Your email" group type="text" validate value={email} onChange={this.onChange} />
                                <MDBInput label="Your password" group type="password" validate value={password} onChange={this.onChange} />
                                <div className="md-form pb-3">
                                    <div className="form-check my-4">
                                        <input
                                            className="form-check-input"
                                            type="checkbox"
                                            value=""
                                            id="defaultCheck17"
                                        />
                                        <label
                                            className="form-check-label white-text"
                                            htmlFor="defaultCheck17"
                                        >
                                            Accept the
                    <a href="#!" className="green-text font-weight-bold">
                                                Terms and Conditions
                    </a>
                                        </label>
                                    </div>
                                </div>
                                <MDBRow className="d-flex align-items-center mb-4">
                                    <div className="text-center mb-3 col-md-12">
                                        <MDBBtn
                                            color="success"
                                            rounded
                                            type="button"
                                            className="btn-block z-depth-1"
                                            disabled={isInvalid}
                                            onSubmit={this.onSubmit}
                                        >
                                            Sign in
                  </MDBBtn>
                                    </div>
                                </MDBRow>
                                <MDBCol md="12">
                                    <p className="font-small white-text d-flex justify-content-end">
                                        Have an account?
                  <a href="#!" className="green-text ml-1 font-weight-bold">
                                            Log in
                  </a>
                                    </p>
                                </MDBCol>
                            </div>
                        </MDBCard>
                    </MDBCol>
                </MDBRow>
            </MDBContainer>
        );
        //     <form onSubmit={this.onSubmit}>
        //         <input
        //             name="email"
        //             value={email}
        //             onChange={this.onChange}
        //             type="text"
        //             placeholder="Email Address"
        //         />
        //         <input
        //             name="password"
        //             value={password}
        //             onChange={this.onChange}
        //             type="password"
        //             placeholder="Password"
        //         />
        //         <button disabled={isInvalid} type="submit">
        //             Sign In
        // </button>

        //         {error && <p>{error.message}</p>}
        //     </form>

    }
}

const SignInForm = compose(
    withRouter,
    withFirebase,
)(SignInFormBase);

export default SignInPage;

export { SignInForm };
